    false,nt"url": null,nt"notes": "This report describes capturing, banding,
    and transplanting the Aleutian Canada Good on selected nesting islands in the Aleutian
    Island Unit of the Alaska Maritime National Wildlife Refuge. Hand-reared and wild
    birds were used in attempt to reestablish nesting in the fox-free environment of
    the Aleutian Chain. The document describes the methods and materials, bird banding
    and capturing, and the subsequent outcomes. Attached are the banding schedules and
    weather, bird, mammal, and plant observations.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
